for delete, movie_pos, status_code in [(True, 1, 204), (False, 2, 403)]:
    response = self.app.post('/roles', headers=self.headers, data=json.
        dumps({'email': self.read_user['email'], 'api': self.api, 'roles':
        {'delete': delete}}), content_type='application/json')
    self.assertEqual(response.status_code, 204)
    response = self.app.delete('/%s/movies/%s' % (self.api, self.movies[
        movie_pos]['id']), headers=self.read_user_header, data=json.dumps({
        }), content_type='application/json')
    self.assertEqual(response.status_code, status_code)
